import './home.scss'
export default class Home extends Component{
    render(){
        return(
        <div className="pf__title">
            <div className="pf__title--name">
                <p>Jubi  <span>Chen</span></p> 
                <p>  </p>
            </div>
            <ul className="pf__title--menu">
            {/* style="color:#86858A" */}
                <li >Home</li>
                <li >Resume</li>
                <li >Services</li>
                <li >Blog</li>
                <li >Contact</li>
            </ul>
     </div>)

    }
}
